                description: "Основная экспозиция музея состоит из двух частей. Первая – литературно-историческая, о писателях, чье творчество и жизнь были связаны с рязанской мещерой. Вторая часть – предметы крестьянского быта и промыслов, один шаг, и вы переноситесь в 19 век с самот-каными половичками, деревянной и глиняной утварью, сундуками разных мастей, станками и при-способлениями, и много еще разного необычного.",
